// Find where the individual soon-to-be-married taxa are to be placed within the joint wedge.
let marriedAfter = keysAfter.filter(item => objectAfter[item]["married"]);
for (i=0; i<marriedAfter.length; i++) {
  let startDegMarried = round(objectAfter[marriedAfter[i]]["degrees"][0]);
  let endDegMarried = round(objectAfter[marriedAfter[i]]["degrees"][objectAfter[marriedAfter[i]]["degrees"].length - 1]);
  let range = round(endDegMarried - startDegMarried);
  let totalCountMarried = objectAfter[marriedAfter[i]]["totalCount"];

  let marriables = marriedAfter[i].split(" & ");
  let start = startDegMarried;
  for (j=0; j<marriables.length; j++) {
    let selfTotalCount = objectBefore[marriables[j]]["totalCount"];
    let selfRange = round((selfTotalCount*range) / totalCountMarried);
    let selfStart = round(start);
    let selfEnd = round(selfStart + selfRange);
    start = selfEnd;

    if (marriedAfter[i].includes("&")) {
      objectAfter[marriables[j]] = {};
      objectAfter[marriables[j]]["degrees"] = [selfStart, selfEnd];
      objectAfter[marriables[j]]["layers"] = objectAfter[marriedAfter[i]]["layers"];
      objectAfter[marriables[j]]["fill"] = objectAfter[marriedAfter[i]]["fill"];
    }

    objectBefore[marriables[j]]["stroke"] = "red";
    objectAfter[marriables[j]]["stroke"] = "red";
  }
  if (marriedAfter[i].includes("&")) {
    delete objectAfter[marriedAfter[i]];
  }
}

