function round(number, decimal) {
    if (decimal === void 0) { decimal = 3; }
    return (Math.round(number * Math.pow(10, decimal)) / Math.pow(10, decimal));
}

function frame() {
    for (let i=0; i<iterations; i++) {
        console.log("frame")
        console.log(keysBefore[i+1], objectBefore[keysBefore[i+1]]["stroke"]);
        prevLayers = layersBefore[i];
        newLayers = layersAfter[i];
        prevDegrees = degreesBefore[i];
        newDegrees = degreesAfter[i];
        prevColor = colorsBefore[i];
        newColor = colorsAfter[i];
        console.log(prevLayers, newLayers);
        console.log(prevDegrees, newDegrees);
      
        let intermLayers = prevLayers.map((item, index, array) => {
            let newLayerIndex = item > newLayers[index] ? item - (item - newLayers[index]) * fraction : item + (newLayers[index] - item) * fraction;
            return newLayerIndex;
        });
      
        let intermDegrees = prevDegrees.map((item, index, array) => {
            let newDegree = item > newDegrees[index] ? item - (item - newDegrees[index]) * fraction : item + (newDegrees[index] - item) * fraction;
            return newDegree;
        });
  
        let firstLayerRadius = round(intermLayers[0]*layerWidth);
        let innerArc = calculateArcEndpoints(intermLayers[0], layerWidth, intermDegrees[0], intermDegrees[intermDegrees.length-1]);
        let innerArcPath = `M ${innerArc["x1"]},${innerArc["y1"]} A ${firstLayerRadius},${firstLayerRadius} 0 0 1 ${innerArc["x2"]},${innerArc["y2"]}`;
        if (Math.abs(intermDegrees[intermDegrees.length-1] - intermDegrees[0]) >= 180) {
            innerArcPath = `M ${innerArc["x1"]},${innerArc["y1"]} A ${innerArc["radius"]},${innerArc["radius"]} 0 1 1 ${innerArc["x2"]},${innerArc["y2"]}`;
        };
  
        let subpaths = [innerArcPath];
        let midArc = {};
        for (let i=intermLayers.length-1; i>=0; i--) {
            let curr = intermDegrees[i];
            let prev = i === 0 ? intermDegrees[0] : intermDegrees[i-1];
            midArc = calculateArcEndpoints(intermLayers[i], layerWidth, prev, curr);
            let midArcPath = `L ${midArc["x2"]},${midArc["y2"]} A ${midArc["radius"]},${midArc["radius"]} 0 0 0 ${midArc["x1"]},${midArc["y1"]}`;
            if (Math.abs(curr - prev) >= 180) {
                midArcPath = `L ${midArc["x2"]},${midArc["y2"]} A ${midArc["radius"]},${midArc["radius"]} 0 1 0 ${midArc["x1"]},${midArc["y1"]}`;
            };
            subpaths.push(midArcPath);
        }
        //let lineInnertoOuter = `L ${midArc["x1"]},${midArc["y1"]} ${innerArc["x1"]},${innerArc["y1"]}`;
        //subpaths.push(lineInnertoOuter);
        let d = subpaths.join(" ");
        curatables[i].setAttribute("d", d, midColor(prevColor, newColor));
        curatables[i].style.fill = midColor(prevColor, newColor, fraction);
        console.log("=======")
    }
    
    if (fraction < 1 && sign === ">>") {
        fraction += 0.02;
    } else if (fraction > 0 && sign === "<<") {
        fraction -= 0.02;
    } else {
        clearInterval(intervalId);
        clearInterval(intervalId2);
    }
}
  
function calculateArcEndpoints(layer, layerWidthInPx, deg1, deg2) {
    var radius = layer * layerWidthInPx; // in px
    var x1 = round(radius * cos(deg1) + horizontalShift);
    var y1 = round(- radius * sin(deg1) + verticalShift);
    var x2 = round(radius * cos(deg2) + horizontalShift);
    var y2 = round(- radius * sin(deg2) + verticalShift);

    return {x1: x1, y1: y1, x2: x2, y2: y2, radius:round(radius)};
}
  
function round(number, decimal=3) {
    return (Math.round(number * Math.pow(10, decimal)) / Math.pow(10, decimal));
}
  
function cos(number) {
    return Math.cos(radians(number));
}
  
function sin(number) {
  return Math.sin(radians(number));
}
  
function radians(degrees) {
  degrees = 270 - degrees;
  var pi = Math.PI;
  return degrees * (pi/180);
}
  
function midColor(rgb1, rgb2, coef) {
  if (!coef) {
      coef = 0.5;
  }
  let rgb1List = rgb1.match(/\d+/g)?.map(item => parseInt(item)) ?? [];
  let rgb2List = rgb2.match(/\d+/g)?.map(item => parseInt(item)) ?? [];
  let newRgb = [];
  for (let i = 0; i < 3; i++) {
      let newNum = rgb1List[i] < rgb2List[i] ? rgb1List[i] + (coef * (rgb2List[i] - rgb1List[i])) : rgb1List[i] - (coef * (rgb1List[i] - rgb2List[i]));
      newRgb.push(Math.round(newNum));
  }
  return `rgb(${newRgb[0]}, ${newRgb[1]}, ${newRgb[2]})`;
}

function extendArrays(oldDegreeArray, newDegreeArray, oldLayerArray, newLayerArray) {
  oldDegreeArray = oldDegreeArray.map(item => round(item)), newDegreeArray = newDegreeArray.map(item => round(item));
  let extendedDegreeArray, extendedLayerArray;
  if (oldDegreeArray.length > newDegreeArray.length) {
    extendedDegreeArray = JSON.parse(JSON.stringify(oldDegreeArray)), extendedLayerArray = JSON.parse(JSON.stringify(oldLayerArray));
    let repeatDegree = newDegreeArray[0];
    let repeatLayer = newLayerArray[0];
    for (let i=0; i<oldLayerArray.length; i++) {
      if (!newLayerArray.includes(oldLayerArray[i])) {
        extendedDegreeArray[i] = repeatDegree, extendedLayerArray[i] = repeatLayer;
      }
      else {
        repeatDegree = oldDegreeArray[i], repeatLayer = oldLayerArray[i];
      }
    }

  }
  else {
    extendedDegreeArray = newDegreeArray, extendedLayerArray = newLayerArray;
  }
  return [extendedDegreeArray, extendedLayerArray];
}